import 'dart:convert';

import 'package:collection/collection.dart';
import 'package:flutter/material.dart';

import 'project.dart';
import 'project_status.dart';

@immutable
class Projects {
  final List<ProjectStatus>? projectStatus;
  final List<Project>? projects;

  const Projects({this.projectStatus, this.projects});

  @override
  String toString() {
    return 'Projects(projectStatus: $projectStatus, projects: $projects)';
  }

  factory Projects.(
      Map<String, dynamic> data) {
    return Projects(
      projectStatus: (data['projectStatus'] as List<dynamic>?)
          ?.map((e) => ProjectStatus
              .(
                  e as Map<String, dynamic>))
          .toList(),
      projects: (data['projects'] as List<dynamic>?)
          ?.map((e) => Project
              .(
                  e as Map<String, dynamic>))
          .toList(),
    );
  }

  Map<String, dynamic>
      () {
    return {
      'projectStatus': projectStatus
          ?.map((e) => e
              .())
          .toList(),
      'projects': projects
          ?.map((e) => e
              .())
          .toList(),
    };
  }

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [Projects].
  factory Projects.fromJson(String data) {
    return Projects
        .(
            json.decode(data) as Map<String, dynamic>);
  }

  /// `dart:convert`
  ///
  /// Converts [Projects] to a JSON string.
  String toJson() => json.encode(
      ());

  @override
  bool operator ==(Object other) {
    if (identical(other, this)) return true;
    if (other is! Projects) return false;
    final mapEquals = const DeepCollectionEquality().equals;
    return mapEquals(
        other
            .(),
        ());
  }

  @override
  int get hashCode => projectStatus.hashCode ^ projects.hashCode;
}
